# Data Augmentation

def plot_image(original_image, updated_image):
  plt.figure(figsize = (15,10))

  # original image
  plt.subplot(1,2,1)
  plt.title("Original Image")
  plt.imshow(original_image)

  # Augmented Image
  plt.subplot(1,2,2)
  plt.title("Transformed Image")
  plt.imshow(updated_image)

  plt.show()

